window.bookSummaryJSON = "<p>Fight. Survive. Repeat. The rules of a soldier are simple.</p> <p>Born into service of the Regime, Commander Sela Tyron is about as subtle as a hammer. To hammers, any problem can look like a nail, but things aren't always that easy. When Sela is abandoned with her team on a planet full of insurrectionists, things get complicated.</p> <p>A daredevil rescue by her commanding officer reaps deadly consequences, forcing Sela to choose between the only life she's ever known and the fate of the man she's duty-bound to protect.&nbsp;</p> <p>Her whole life was a lie. And that's the good news.</p> <p>Shirking a life of privilege, Erelah Veradin dreamt of building spaceships and exploring the stars in the service of the Regime. When a monstrous truth about her true heritage is revealed, Erelah finds herself at the unwilling center of a scheming mastermind's bid for power.&nbsp;</p> <p>Suit up. Time to join the fight.</p> <p>Praise for <i>Allies and Enemies: Fallen </i></p> <p>\"Plenty of kick-assery with a refreshing gender reversal.\" (<i>Seven Days VT</i>)</p> <p>\"A solid SF tale. It has a nice layered storyline with a relatively fast paced plot...everything you would want in a SF suspense space opera.\" (<i>Midwest Book Review</i>, Feb 2017)&nbsp;&nbsp;</p>"; 
